import{_ as e,c as s,a1 as i,o as t}from"./chunks/framework.Bt6yzAO9.js";const m=JSON.parse('{"title":"数据管理","description":"","frontmatter":{},"headers":[],"relativePath":"admin-guide/data.md","filePath":"admin-guide/data.md"}'),r={name:"admin-guide/data.md"};function l(n,a,o,d,c,u){return t(),s("div",null,a[0]||(a[0]=[i('<h1 id="数据管理" tabindex="-1">数据管理 <a class="header-anchor" href="#数据管理" aria-label="Permalink to &quot;数据管理&quot;">​</a></h1><h2 id="回收站" tabindex="-1">回收站 <a class="header-anchor" href="#回收站" aria-label="Permalink to &quot;回收站&quot;">​</a></h2><h3 id="功能概述" tabindex="-1">功能概述 <a class="header-anchor" href="#功能概述" aria-label="Permalink to &quot;功能概述&quot;">​</a></h3><p>应用下的字段及应用下的数据被删除后，可在回收站操作恢复。系统会将删除的数据暂存15天，15天后将会被清空。</p><h3 id="操作入口" tabindex="-1">操作入口 <a class="header-anchor" href="#操作入口" aria-label="Permalink to &quot;操作入口&quot;">​</a></h3><p>进入【管理后台】，点击【应用管理】，进入应用管理页面，在【扩展插件】分栏中找到【回收站】，进入删除数据列表页面，查看并设置数据恢复。</p><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-143.png" alt=""></p><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-144.png" alt=""></p><h3 id="恢复删除字段" tabindex="-1">恢复删除字段 <a class="header-anchor" href="#恢复删除字段" aria-label="Permalink to &quot;恢复删除字段&quot;">​</a></h3><p>进入删除字段列表，选择需要恢复的被删除字段，点击【恢复】按钮即可将被删除字段恢复至应用中。</p><p>点击【删除】按钮则将字段彻底删除，彻底删除的数据不可恢复，请谨慎操作。</p><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-145.png" alt=""></p><h3 id="恢复删除数据" tabindex="-1">恢复删除数据 <a class="header-anchor" href="#恢复删除数据" aria-label="Permalink to &quot;恢复删除数据&quot;">​</a></h3><p>进入删除数据列表，选择应用，列表展示应用下被删除数据，选择需要恢复的数据，点击【恢复】按钮即可将被删除数据恢复至应用列表下。</p><p>点击【删除】按钮则将数据彻底删除，彻底删除的数据不可恢复，请谨慎操作。</p><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-146.png" alt=""></p><h2 id="导入数据" tabindex="-1">导入数据 <a class="header-anchor" href="#导入数据" aria-label="Permalink to &quot;导入数据&quot;">​</a></h2><h3 id="操作入口-1" tabindex="-1">操作入口 <a class="header-anchor" href="#操作入口-1" aria-label="Permalink to &quot;操作入口&quot;">​</a></h3><p>进入【管理后台】，点击【导入数据】，进入导入数据操作页面</p><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-147.png" alt=""></p><h3 id="导入操作步骤" tabindex="-1">导入操作步骤 <a class="header-anchor" href="#导入操作步骤" aria-label="Permalink to &quot;导入操作步骤&quot;">​</a></h3><ol><li>整理数据：导入前，请先导出一份当前应用的数据作为模板，参照模板汇总的示例，导入数据时系统会严格校验数据格式，请仔细阅读【导入说明】做好数据整理工作，否则数据导入时很容易报错。</li><li>上传文件：将整理好的数据文件上传。</li><li>数据预览：提交上传文件后生成预览数据，确认表格中的数据能被系统所识别。</li></ol><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-148.png" alt=""></p><ol start="4"><li>选择应用：选择数据需要导入的应用及布局</li></ol><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-149.png" alt=""></p><ol start="5"><li>字段映射：将表头名称与系统中的字段建立映射关系，系统会自动将同名的字段进行关联映射。选择“是否判断数据重复，当数据重复时，选择判断重复的字段以及执行“跳过、覆盖”操作类型。</li></ol><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-150.png" alt=""></p><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-151.png" alt=""></p><ol start="6"><li>导入数据，导入完成后会显示结果报告，如果数据量较大，可不必在页面上等待，系统会自动在后台执行导入，完成后会自动以消息通知的方式发送结果报告。点击页面顶部导航右侧【消息】入口进行查看。</li></ol><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-152.png" alt=""></p>',30)]))}const h=e(r,[["render",l]]);export{m as __pageData,h as default};
